window.bookSummaryJSON = "<p>Owner of the Chimay grade starship dubbed <i>The Pittsburgh</i>, Captain Jane Sevis is one of the best bounty hunters in the galaxy. Except for the occasional problematic hunt, her life is pretty uncomplicated. When a particularly slippery target reveals the real reason for being in her database, her world is turned upside down in more ways than one. Will she follow her gut and look the other way for the man she may be falling for? Or will their love fall prey to her mercenary heart before it gets a real chance to ignite? </p>"; 
